import * as React from "react";
import { Autocomplete, Stack, TextField, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useState, Component } from "react";
import Dropzone from 'react-dropzone'

export const CreateProduct = () => {
  const [value, setValue] = React.useState("");
  const [image, setImage] = useState();

  const handleImage = (e) => {
         console.log(e.target.files);
         setImage(URL.createObjectURL(e.target.files[0]));
     }

console.log(image)
  const handleChange = (event) => {
    setValue(event.target.value);
  };
  const handleDrop = ( ) => {
    console.log()
  }


  return (
    <>
      <Box
        sx={{
          width: 300,
        }}
      >
        <Typography variant="h6">choose a category</Typography>
        <Autocomplete
          freeSolo
          id="free-solo-2-demo"
          disableClearable
          options={tags.map((option) => option.title)}
          renderInput={(params) => (
            <TextField
              {...params}
              label="choose a category"
              InputProps={{
                ...params.InputProps,
                type: "search",
              }}
            />
          )}
        />
      </Box>

      <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    >
      <div>
        <TextField
          id="outlined-multiline-flexible"
          label="111111"
          multiline
          maxRows={4}
          value={value}
          onChange={handleChange}
        />
        <TextField
          id="outlined-textarea"
          label="22222222"
          placeholder="Placeholder"
          multiline
        />
        <TextField
          id="outlined-multiline-static"
          label="333333333"
          multiline
          rows={4}
          defaultValue="33333333"
        />
      </div>
      <div>
        <TextField
          id="filled-multiline-flexible"
          label="44444444"
          multiline
          maxRows={4}
          value={value}
          onChange={handleChange}
          variant="filled"
        />
        <TextField
          id="filled-textarea"
          label="5555555555"
          placeholder="Placeholder"
          multiline
          variant="filled"
        />
        <TextField
          id="filled-multiline-static"
          label="666666666666"
          multiline
          rows={4}
          defaultValue="Default Value"
          variant="filled"
        />
      </div>
      <div>
        <TextField
          id="standard-multiline-flexible"
          label="77777777777"
          multiline
          maxRows={4}
          value={value}
          onChange={handleChange}
          variant="standard"
        />
        <TextField
          id="standard-textarea"
          label="8888888888"
          placeholder="Placeholder"
          multiline
          variant="standard"
        />
        <TextField
          id="standard-multiline-static"
          label="999999999"
          multiline
          rows={4}
          defaultValue="Default Value"
          variant="standard"
        />
      </div>
    </Box>
    </>
  );
};

const tags = [
  { title: "Art" },
  { title: "Music" },
  { title: "Photography" },
  { title: "Collectibles" },
  { title: "Domain" },
];
